import React from 'react';
import { ChakraProvider, Box } from '@chakra-ui/react';
import TextAnalyzer from './components/TextAnalyzer';

function App() {
  return (
    <ChakraProvider>
      <Box minH="100vh" p={4}>
        <TextAnalyzer />
      </Box>
    </ChakraProvider>
  );
}

export default App;
